    "stwb102" : MessageLookupByLibrary.simpleMessage("Dengan pengaruh RISE Financial Holding Group, kami akan menyepadukan projek kebajikan awam berkualiti tinggi global, supaya penderma boleh mempercayai dan mengambil bahagian secara lebih aktif dalam usaha kebajikan awam."),
