    "stwb106" : MessageLookupByLibrary.simpleMessage("Aset pengguna diuruskan oleh kontrak pintar dan dikawal oleh pengguna. Pengguna boleh memilih sama ada untuk mengurus nilai aset digital. Pertukaran tidak menyentuh aset pengguna."),
    "stwb107" : MessageLookupByLibrary.simpleMessage("Pengurusan kewangan"),
    "stwb108" : MessageLookupByLibrary.simpleMessage("RISE Earn ialah aplikasi pengurusan kewangan dalam rantaian yang dilancarkan oleh platform RISE berdasarkan perkhidmatan pelaburan aset digital. Ia menyediakan pengguna dengan penyelesaian pelaburan jangka panjang yang komprehensif, pelbagai dan diperibadikan, termasuk Earn semasa aset digital biasa/biasa program, Kami akan melancarkan aktiviti Earn terhad masa dari semasa ke semasa.\n Produk pelaburan dan pengurusan kekayaan yang dilancarkan oleh RISE Earn mempunyai imbuhan yang agak stabil dan ambang pelaburan yang rendah. direalisasikan."),
