    "stwb118" : MessageLookupByLibrary.simpleMessage("Mohon"),
    "stwb119" : MessageLookupByLibrary.simpleMessage("Bina sistem Internet yang lebih dipercayai, dan integrasikan rantaian blok dengan medan hartanah untuk menyelesaikan secara asas kemungkinan penipuan antara urus niaga hartanah."),
