    "stwb122" : MessageLookupByLibrary.simpleMessage("Pelancongan"),
    "stwb123" : MessageLookupByLibrary.simpleMessage("RISE Briged menaik taraf bentuk pelancongan Internet melalui bentuk blockchain + pelancongan, memecahkan mod sambungan platform pelancongan berpusat tradisional, dan membentuk ekosistem nilai baharu industri pelancongan. Ia membuka bahagian atas, pertengahan dan capaian industri yang lebih rendah dan meningkatkan kecekapan kerjasama dengan berkesan. Mengurangkan kos industri dengan ketara dan merealisasikan kaedah transaksi pelancongan yang lebih cekap dan mudah. â€‹â€‹Memperbaiki persekitaran industri, pengagihan pendapatan dan mekanisme pembayaran pengguna, melindungi kepentingan semua peserta secara berkesan, dan sepenuhnya mengubah wajah industri pelancongan."),
