    "stwb13" : MessageLookupByLibrary.simpleMessage("Pendidikan"),
    "stwb130" : MessageLookupByLibrary.simpleMessage("Pengembara dan ejen pelancongan akan merekodkan semua transaksi dalam satu blok; program kesetiaan dan mata pelancong boleh disimpan dalam blok; perjanjian komisen antara syarikat penerbangan, hotel dan ejen tempahan juga akan menjadi sangat jelas Bahagikan siapa yang mendapat bayaran dan bila; perjanjian korporat dengan ejen pelancongan boleh disimpan selama-lamanya tanpa sebarang pertanyaan atau bayaran tersembunyi."),
